// Измените путь к текстовому файлу в соответствии с вашим окружением
var filePath = "/path/to/your/file.txt"; 

// Функция для чтения файла и возврата содержимого в виде массива строк
function readLines(filePath) {
    var file = new File(filePath);
    file.open('r');
    var lines = [];
    while (!file.eof) {
        lines.push(file.readln());
    }
    file.close();
    return lines;
}

// Функция для записи массива строк обратно в файл
function writeLines(filePath, lines) {
    var file = new File(filePath);
    file.open('w');
    for (var i = 0; i < lines.length; i++) {
        file.writeln(lines[i]);
    }
    file.close();
}

// Функция для получения цвета пикселя по координатам
function getPixelColor(x, y) {
    var samplePoint = [x, y];
    var colorSampler = app.activeDocument.colorSamplers.add(samplePoint);
    var color = colorSampler.color;
    colorSampler.remove(); // Удаляем сэмплер после использования
    return [color.rgb.red, color.rgb.green, color.rgb.blue, color.rgb.hexValue]; // Возвращаем цвет в формате RGBA
}

function processFile(filePath) {
    var lines = readLines(filePath);
    var newLines = [];
    for (var i = 0; i < lines.length; i++) {
        var components = lines[i].split(':');
        if (components.length === 7) {
            var x = parseFloat(components[1]);
            var y = parseFloat(components[2]);
            // Получаем значения цвета для точки с координатами (x, y)
            var color = getPixelColor(x, y);
            // Создаем новую строку с обновленными значениями цвета
            var newLine = components[0] + ':' + components[1] + ':' + components[2] + ':' + Math.round(color[0]) + ':' + Math.round(color[1]) + ':' + Math.round(color[2]) + ':' + color[3];
            newLines.push(newLine);
        }
    }
    // Записываем обновленные данные обратно в файл
    writeLines(filePath, newLines);
}

// Выполнение процесса с заданным файлом
processFile(filePath);